import React from 'react';
import { categories_row1 } from './categorieslist';
import "./categories.css"

export function Category() {
  return (
    <div>
      <div className='row'>
        {categories_row1.map((category) => 
          <div className='col' key={category.id}>
            <img src={category.imageURL}/>

          </div>
        )}
      </div>
    </div>
  );
}
